import React from "react";
import MainPage from "./MainPage";
import "../stylesheets/reset.css";
import { Route, Switch } from "react-router-dom";


function App() {
  return (
    <Router>
      <Switch>
        <Route path="/" component={MainPage} />
      </Switch>
    </Router>
  );
}

export default App;
